model Q/Vac_Control_Gain_for_droop_control

equation
	yo = Selfix(Mode, K * yi, 0);

end Q/Vac_Control_Gain_for_droop_control;

function Selfix
	input Boolean boolexpr;
	input Real x;
	input Real y;
	output Real outputexpr;
	parameter Real initializedVariable;
algorithm
	initializedVariable = conditionalInitialization(boolexpr);
	if initializedVariable then
		outputexpr = x;
	else
		outputexpr = y;
	end if;
end Selfix;

model Q/Vac_Control_Power_Factor_to_Power

equation
	sign_Qpf = Select(pf_dir, -1, 1);
	Qpf_ref = Select(abs(pf_ref)<0.01, Q_ref, sign_Qpf*abs(P)*tan(acos(LimConst(abs(pf_ref),0.01,1.00))));
	S  = sqrt(max(0.0, (P^2+Q^2)));
	pf = max(0.0, min(1.0, abs(P/max(0.00000001,S))));

end Q/Vac_Control_Power_Factor_to_Power;

function Select
	input Boolean boolexpr;
	input Real x;
	input Real y;
	output Real varA;
algorithm
	if boolexpr then
		varA = x;
	else
		varA = y;
	end if;
end Select;

function LimConst
	input Real x;
	input Real minLim;
	input Real maxLim;
	output Real yo;
algorithm
	if x < minLim then
		yo = minLim;
	else if x > maxLim then
		yo = maxLim;
	else
		yo = x;
	end if;
end LimConst;

model Q/Vac_Control_Gradient_Limiter_3

equation
	yo = Selfix(gradlim_on, GradLim(Selfix(gradlim_on,yi,0),(dy_min/100),(dy_max/100)), yi);

end Q/Vac_Control_Gradient_Limiter_3;

function Selfix
	input Boolean boolexpr;
	input Real x;
	input Real y;
	output Real outputexpr;
	parameter Real initializedVariable;
algorithm
	initializedVariable = conditionalInitialization(boolexpr);
	if initializedVariable then
		outputexpr = x;
	else
		outputexpr = y;
	end if;
end Selfix;

function GradLim
	input Real inputSignal;
	input Real minGradient;
	input Real maxGradient;
	output Real outputSignal;
algorithm
	if der(inputSignal) > maxGradient then
		outputSignal = maxGradient+inputSignal;
	else if der(inputSignal) < minGradient then
		outputSignal = minGradient+inputSignal;
	else
		outputSignal = inputSignal+der(inputSignal);
	end if;
end GradLim;

model Q/Vac_Control

equation
	if (Mode_Q>1.5  and  (abs(pf_ref)<0.01)) then
		print("Power factor reference is too small for power factor control! Control mode changes to reactive power control.");
	end if;
end Q/Vac_Control;

cim:FunctionDescriptor.cim:FunctionDescriptor.initialConditions:
Real uac (start = Selfix(poc_Vac, uac_poc, uac_loc));
Real uac_ref (start = Selfix(Mode_Vac_Droop, uac+Dvac*Q, uac));
Real Q (start = Selfix(poc_Q, Q_poc, Q_loc));
Real Q_ref (start =  Q - dQ_pod);
Real pf_ref (start =  max(0.0, min(1.0, abs(P/max(0.00000001,sqrt(max(0.0, sqr(P)+sqr(Q_ref))))))));
Boolean pf_dir (start = selfix(Q_ref>=0, 0, 1));
Real dQ_pod;
    if noEvent(abs(dQ_pod))) < 1e-6 then
    dQ_pod = 0;
end if;
Real xiQ (start = Selfix(Mode_Output, uac_loc_ref, (Selfix(Mode_Q,iQ_ref*Selfix(Mode_Vadp,max(uac_loc,Vac_min),1.0),iQ_ref))));
//! Operation without transient models FRT blocks, etc.
Boolean FRT;
    if noEvent(abs(FRT))) < 1e-6 then
    FRT = 0;
end if;
Boolean block;
    if noEvent(abs(block))) < 1e-6 then
    block = 0;
end if;
Real iQ_in_limit;
    if noEvent(abs(iQ_in_limit))) < 1e-6 then
    iQ_in_limit = 0;
end if;
//! Open loop test purposes
Real iQ_ref;
    if noEvent(abs(iQ_ref))) < 1e-6 then
    iQ_ref = 0;
end if;
Real uac_loc_ref;
    if noEvent(abs(uac_loc_ref))) < 1e-6 then
    uac_loc_ref = 1;
end if;

