model Q/Vac_Control_Gain_for_droop_control_with_deadband

equation
	over_droop_db  = Selfix(Mode_Q_Droop and Mode_Q_Droop_Db, Picdro(Vac-Vac_droop_max_db+0.5, Selfix(Mode_Q_Droop and Mode_Q_Droop_Db, 0.0, 999999.), 0.0), 0);
	under_droop_db = Selfix(Mode_Q_Droop and Mode_Q_Droop_Db, Picdro(Vac_droop_min_db-Vac+0.5, Selfix(Mode_Q_Droop and Mode_Q_Droop_Db, 0.0, 999999.), 0.0), 0);
	droop = Selfix(Mode_Q_Droop, Selfix(Mode_Q_Droop_Db, Select(over_droop_db, (Vac-Vac_droop_max_db)*Dq, Select(under_droop_db,(Vac-Vac_droop_min_db)*Dq, 0)), (Vac-Vac_ref)*Dq),0);

end Q/Vac_Control_Gain_for_droop_control_with_deadband;

function Selfix
	input Boolean boolexpr;
	input Real x;
	input Real y;
