model Q/Vac_Control_PI_regulator

equation
	Kp = Select(mode_Q>0.5, Kp_Q, Kp_Vac);
	Ki = Select(mode_Q>0.5, Ki_Q, Ki_Vac);
	y_max = Selfix(mode_out, Vac_ref_max, Select(mode_Q>0.5, Q_max, iQ_max));
	y_min = Selfix(mode_out, Vac_ref_min, Select(mode_Q>0.5, Q_min,-iQ_max));
	freeze_int =  Selfix(mode_out, Picdro(block or FRT or (iQ_in_limit and ((xiQ>1 and yi>0) or (xiQ<1 and yi<0))), 0.000, 0.001), Picdro(block or FRT or (iQ_in_limit and ((xiQ>0 and yi>0) or (xiQ<0 and yi<0))), 0.000, 0.001));
	der(xiQ) = Select(freeze_int, 0.0, Select((Flipflop(pre(xiQ)+Lim(Kp*yi,min(-y_max,y_min),max(-y_min,y_max))>y_max,pre(xiQ)+Lim(Kp*yi,min(-y_max,y_min),max(-y_min,y_max))<y_max) and Flipflop(yi>0.0,yi<0.0)) or (Flipflop(pre(xiQ)+Lim(Kp*yi,min(-y_max,y_min),max(-y_min,y_max))<y_min,pre(xiQ)+Lim(Kp*yi,min(-y_max,y_min),max(-y_min,y_max))>y_min) and Flipflop(yi<0.0,yi>0.0)), 0.0,  Ki*yi));
	yo = max(y_min,min(y_max,LimState(xiQ,y_min-0.0000001,y_max+0.0000001)+Kp*yi));  // More robust than solution with Lim() function in simulations with large time steps

end Q/Vac_Control_PI_regulator;

function Select
	input Boolean boolexpr;
	input Real x;
	input Real y;
	output Real varA;
algorithm
	if boolexpr then
		varA = x;
	else
		varA = y;
	end if;
end Select;

function Selfix
	input Boolean boolexpr;
