function Picdro
	input Boolean boolexpr;
	input Real Tpick;
	input Real Tdrop;
	output Boolean varA;
algorithm
	if boolexpr = true then
		varA = delay(1,Tpick);
	else if boolexpr = false then
		varA = delay(0,Tdrop);
	else
		varA = pre(varA)
	end if;
end Picdro;

function Flipflop
	input  Boolean boolset;
	input  Boolean boolreset;
	output Boolean state;
algorithm
	if (boolset = true) and (boolreset = false) then
		state := true;
	end if;
	if (boolset = false) and (boolreset = true) then
		state := false;
	end if;	
end Flipflop;

function Lim
	input Real x;
	input Real minLim;
	input Real maxLim;
	output Real yo;
algorithm
	if x < minLim then
		yo = minLim;
	else if x > maxLim then
		yo = maxLim;
	else
		yo = x;
	end if;
end Lim;

function LimState
	input Real x1 (stateSelect=StateSelect.always);
	input Real xmin;
	input Real xmax;
	output Real yo;
algorithm
	domainType = 1; // 1 for RMS, 0 for EMT simulation
	if x < xmin then
		yo = xmin;
	else if x > xmax then
		yo = xmax;
	else
		yo = x1;
	end if;
end LimState;

cim:FunctionDescriptor.cim:FunctionDescriptor.initialConditions:
Real Kp (start =  Selfix(mode_Q>0.5, Kp_Q, Kp_Vac));
Real Ki (start =  Selfix(mode_Q>0.5, Ki_Q, Ki_Vac));
Real y_max (start =  Selfix(mode_out, Vac_ref_max, Selfix(mode_Q>0.5, Q_max, iQ_max));
Real y_min (start =  Selfix(mode_out, Vac_ref_min, Selfix(mode_Q>0.5, Q_min,-iQ_max));
Real freeze_int (start =  Selfix_const(block or FRT, 1, 0));
